(9, 'Приглашаем принять участие в Круглом столе «Инновации в банковском бизнесе: перспективы и риски»', '<p>Приглашаем принять участие в Круглом столе из цикла «Будущее финансовых рынков: эволюция технологий», на тему «Инновации в банковском бизнесе: перспективы и риски» 21 февраля c 10:00 до 14:00</p><h4>Место проведения:</h4><p>г. Москва, ул. Варварка, д. 3</p><h4>Организаторы:</h4><p>НП «Профессионалы электронного рынка»</p><h4>Партнеры:</h4><p>НКЦ «Эталонъ»<br>Мобильный оценщик</p><h4>Стратегический информационный партнер:</h4><p>Международный Клуб «ИНТЕГРАЦИЯ»</p><hr><p>Эксперты Всемирного экономического форума отмечают, что в 2017 году развитие робототехники будет вытеснять человеческий труд из сферы услуг. «Мы живем в переломное время, когда технологический процесс может создать массу проблем»- это слова директора по рискам Zurich Insurance Group Сесилии Рейес.</p><p>Одним из ТОП-5 трендов, определяющих мировое развитие, является растущая киберзависимость. В результате развития технологий к 2020 году число рабочих мест в мире сократится на 5 млн. человек (две трети из которых составят административные и офисные работники). Сокращение рабочих мест станет результатом инновационной перестройки крупнейших мировых экономик.</p><p>Интернет банкинг, мобильный банкинг, биометрические платежи, криптовалюты, электронные закупки, online продажи недвижимости – все это наша реальность. Блокчейн, кибербезопасность, банкинг вещей, мобильные финансовые приложения – эти термины с ужасающей быстротой входят в жизнь финансового сообщества. Обсудить новые актуальные тренды в сфере инноваций в банковском бизнесе мы пригласили первых лиц банковского мира – представителей власти и бизнеса.</p><h4>Аудитория мероприятия:</h4><p>представители крупнейших банков и финансовых структур (руководители IT-подразделений; начальники управлений по работе с залоговым имуществом; кредитованию; управлению проблемными активами и просроченной задолженностью, руководители рисковых подразделений, юридических департаментов и т.д.); <br>представители ведущих IT-компаний (генеральные директора, руководители ключевых департаментов);<br>представители профильных государственных органов, общественных организаций и СМИ.</p><h2>Ключевые темы:</h2><h5>Блок 1</h5><ul><li>Инновационные стратегии развития крупнейших российских банков: банковские сервисы</li><li>Банковские розничные продукты. Перевод продуктов в online на примере конкретных кейсов. Опыт крупных банков</li><li>Роботизация финансовых услуг</li><li>Карты или платежи с телефона? Новые технологии</li><li>Финансовые инновации и киберугрозы: нарастающий рост</li><li>Право в цифровом мире: проблемы и перспективы развития</li></ul><h5>Блок 2</h5><ul><li>Монетизация Big data в банках</li><li>Облачные технологии в банковском секторе</li><li>Online-оценка имущества для оформления кредитных продуктов</li><li>Банки и крупнейшие операторы связи: перспективы развития сотрудничества</li><li>Взыскание задолженности: автоматизация процесса</li><li>Уход региональных бэк-офисов в онлайн: что ждет рынок недвижимости?</li></ul><h2>Модератор дискуссии:</h2><p>Аитов Тимур, член Комитета ТПП РФ по финансовым рынкам и кредитным организациям, банковский эксперт*</p><h2>Приглашены к участию:</h2><p>Аксаков Анатолий, Председатель Комитета Госдумы по финансовым рынкам, Президент Ассоциации региональных банков России<br>Грачев Иван, Президент международной академии ипотеки и недвижимости, Депутат Государственной Думы Российской Федерации*<br>Афонский Владимир, Депутат Государственной Думы Российской Федерации (Комитет по транспорту и строительству), фракция "Единая Росиия"* <br>Самиев Павел, Управляющий директор Национального рейтингового агентства*<br>Благирев Алексей, Директор по инновациям банка "Открытие"*<br>Прохоров Роман, Председатель Правления Ассоциации финансовых инноваций*<br>Криворучко Светлана, Директор Центра денежно-кредитной политики Финансового университета при Правительстве Российской Федерации*<br>Гамза Владимир, Управляющий партнер DDP GROUP, Заместитель проректора по науке Финансового университета при Правительстве Российской Федерации*<br>Морозов Александр, Первый вице-президент НАПКА (национальная ассоциация профессиональных коллекторских агентств), Президент компании "Финкарта"*<br>Рыкова Инна, Доктор экономических наук, академик РАЕН, руководитель центра отраслевой экономики ФГБУ «Научно-исследовательский финансовый институт» Министерства финансов Российской Федерации<br>Пушко Александр, Заместитель директора Банковского института Национального исследовательского университета "Высшая школа экономики"*<br>Раев Константин, Директор НП "Профессионалы электронного рынка", Первый заместитель генерального директора АО "Российский аукционный дом"*<br>Смирнова Ольга, Руководитель проектного офиса компании СКБ Контур<br>Шикин Владимир, Заместитель директора по развитию бизнеса НБКИ*<br>Представители фонда по развитию интернет – инфраструктуры (ФРИИ)</p><h3>Участие в круглом столе позволит Вам:</h3><p>узнать мнение ведущих аналитиков и экспертов о том, какие изменения ждут банковский рынок в 2017 году и о наиболее выгодных инновационных стратегиях развития бизнеса<br>встретиться с представителями бизнеса, власти, финансово-кредитных институтов в формате тет-а-тет, адресно найти решение вопроса, с которым столкнулся Ваш бизнес<br>рассказать о своих продуктах и услугах.</p><p><strong>Участие для членов Союза ФЭСЭ бесплатное.<br>Количество мест ограниченно.</strong></p><p><br>Заявки направлять по адресу: <a href="mailto:finsudexpert@inbox.ru">finsudexpert@inbox.ru </a></p>', 1487660400, 'new_meropr', '', '', '', 1487140200, 1487164275, 1),
(10, 'Союз ФЭСэ и Головной центр дополнительного профессионального образования МИИГАиК приглашают на профессиональную переподготовку', '<h3><strong>СОЮЗ ФИНАНСОВО - ЭКОНОМИЧЕСКИХ СУДЕБНЫХ ЭКСПЕРТОВ<br></strong>и<br><strong>Головной центр дополнительного профессионального образования МИИГАиК</strong></h3><p>приглашают на профессиональную переподготовку по программе:</p><h2>СУДЕБНАЯ ЗЕМЛЕУСТРОИТЕЛЬНАЯ ЭКСПЕРТИЗА</h2><p><img src="/upload/file/2017/02/logo-miigaik_2.jpg"></p><p>Объем программы: 306 часов<br>Форма обучения: очно-заочная, с применением электронного обучения,<br>лекции онлайн по субботам<br>Сроки обучения: февраль - апрель 2017 г.,<br>Подробности по запросу.</p><hr><p><br>По окончании обучения выдается диплом о профессиональной переподготовке установленного образца с присвоением квалификации дающий право профессиональной деятельности в новой сфере.<br>Данные о судебных экспертах, прошедших обучение по программе, размещаются в Справочнике финансово-экономических судебных экспертов, который направляется в суды, правоохранительные органы, адвокатуры <a href="/upload/file/2017/02/spravochnik-advokata-1.pdf">spravochnik-advokata.pdf</a></p><p><strong>Стоимость обучения</strong>: <br>58 000 рублей для членов Союза ФЭСЭ (с рассрочкой платежа),<br>НДС не облагается.</p><p><br><strong>Для зачисления необходимо направить:</strong><br>1) Копию паспорта (стр. 2,3 + прописка).<br>2) Копию диплома о высшем образовании</p><p><strong>Подробности по запросу:</strong></p><p>finsudexpert@mail.ru</p><p>тел. +7 916 238 08 00</p><p>тел. +7 495 226 63 39</p><hr><p><u><a href="http://finsudexpert.ru/userfiles/file/%D0%90%D0%BD%D0%BE%D0%BD%D1%81%20%D0%BF%D1%80%D0%BE%D0%B3%D1%80%D0%B0%D0%BC%D0%BC%D1%8B.pdf"></a><a href="/upload/file/2017/02/_0.pdf">Скачать анонс программы</a><br></u></p>', 1487160960, 'new_merop', '', '', '', 1487161200, 1487161297, 1);
