INSERT INTO `post` (`id`, `title`, `body`, `slug`, `seotitle`, `keywords`, `description`, `created_at`, `updated_at`, `status`) VALUES
(7, 'Союз ФЭСэ и Головной центр дополнительного профессионального образования МИИГАиК приглашают на профессиональную переподготовку', '<h3><strong>СОЮЗ ФИНАНСОВО - ЭКОНОМИЧЕСКИХ СУДЕБНЫХ ЭКСПЕРТОВ </strong>и<br>\r\n<strong>Головной центр дополнительного профессионального образования МИИГАиК</strong></h3><p>приглашают на профессиональную переподготовку по программе:\r\n</p><p><br></p><h2>СУДЕБНАЯ ЗЕМЛЕУСТРОИТЕЛЬНАЯ ЭКСПЕРТИЗА</h2><p><img class="img-left" src="/upload/file/2017/02/logo-miigaik.jpg" width="100" height="122" border="0" align="left" hspace="0" alt="" style="padding: 5px; margin-right: 5px;">\r\n</p><p>Объем программы: 306 часов<br>\r\n	Форма обучения: очно-заочная, с применением электронного обучения,<br>\r\n	лекции онлайн по субботам<br>\r\n	Сроки обучения: февраль - апрель 2017 г.,<br>\r\n	Подробности по запросу.\r\n</p><hr><p><br>\r\n	По окончании обучения выдается диплом о профессиональной переподготовке установленного образца с присвоением квалификации дающий право профессиональной деятельности в новой сфере.<br>\r\n	Данные о судебных экспертах, прошедших обучение по программе, размещаются в Справочнике финансово-экономических судебных экспертов, который направляется в суды, правоохранительные органы, адвокатуры <a href="/upload/file/2017/02/spravochnik-advokata.pdf">spravochnik-advokata.pdfspravochnik-advokata.pdf</a></p><p><strong>Стоимость обучения</strong>: <br>\r\n	58 000 рублей для членов Союза ФЭСЭ (с рассрочкой платежа),<br>\r\n	НДС не облагается.\r\n</p><p><br>\r\n	<strong>Для зачисления необходимо направить:</strong><br>\r\n	1) Копию паспорта (стр. 2,3 + прописка).<br>\r\n	2) Копию диплома о высшем образовании\r\n</p><p><strong>Подробности по запросу:</strong>\r\n</p><p>finsudexpert@mail.ru\r\n</p><p>тел. +7 916 238 08 00\r\n</p><p>тел. +7 495 226 63 39\r\n</p><hr><p><a href="/upload/file/2017/02/.pdf">Скачать анонс программы</a><br></p>', 'perepodgotovka', ' 	НП ФИНАНСОВО-ЭКОНОМИЧЕСКИХ СУДЕБНЫХ ЭКСПЕРТОВ | Союз ФЭСэ и Головной центр дополнительного профессионального образования МИИГАиК приглашают на профессиональную переподготовку', '', '<p>СУДЕБНАЯ ЗЕМЛЕУСТРОИТЕЛЬНАЯ ЭКСПЕРТИЗА<br />\r\nФевраль - апрель 2017 г.</p>', 1484920260, 1487164622, 1),
(8, 'Корпоративное обучение и повышение квалификации в РГУП по программе СОЭ', '<h1>\r\n        Корпоративное обучение и повышение квалификации в РГУП по программе СОЭ\r\n    </h1><h3>СОЮЗ «ФИНАНСОВО-ЭКОНОМИЧЕСКИХ СУДЕБНЫХ ЭКСПЕРТОВ» и<br>\r\nРоссийский государственный университет правосудия</h3><p>приглашают на профессиональную переподготовку по программе</p><h2>«СУДЕБНО - ОЦЕНОЧНАЯ ЭКСПЕРТИЗА»</h2><p><a href="/userfiles/file/%D0%90%D0%BD%D0%BE%D0%BD%D1%81%20%D0%BF%D1%80%D0%BE%D0%B3%D1%80%D0%B0%D0%BC%D0%BC%D1%8B%20C%D0%9E%D0%AD%20%D0%BC%D0%B0%D1%80%D1%82%202017.pdf"></a><a href="/upload/file/2017/02/c-2017.pdf">Скачать анонс программы СОЭ</a><br></p><p><a href="/userfiles/file/%D0%97%D0%B0%D1%8F%D0%B2%D0%BA%D0%B0%20C%D0%9E%D0%AD.doc"></a><a href="/upload/file/2017/02/c.doc">Заявка.docx</a><br></p><hr><p>В результате обучения слушатель получает теоретические и практические знания проведения судебной оценочной экспертизы.</p><p>Занятия ведут лекторы из числа профессорско-преподавательского состава Российского государственного университета правосудия, практикующие судебные эксперты, судьи.</p><p>Для обучения по программе профессиональной переподготовки «Судебно -оценочная экспертиза» приглашаются оценщики, имеющие стаж работы не менее 3 лет.<br>\r\nОбъем программы: <strong>600 часов</strong><br>\r\nФорма обучения: <strong>очно-заочная</strong>, с применением электронного обучения, лекции онлайн по субботам<br>\r\nСроки обучения: <strong>март – июль 2017 г.,</strong><br>\r\nМесто проведения: г. Москва ул. Новочеремушкинская, 69</p><hr><p><strong>Программа состоит из трех частей:</strong><br>\r\nЧасть 1: «Теоретические основы судебно-оценочной экспертизы»</p><ul>\r\n    <li>Современная теория судебной экспертизы</li>\r\n    <li>Организационно и процессуальные основы судебной оценочной экспертизы</li>\r\n    <li>Методология судебной оценочной экспертизы</li>\r\n    <li>Правовое, методическое и информационное обеспечение судебно-экспертных<br>\r\n    технологий</li>\r\n</ul><p>Часть 2: «Судебно – оценочная экспертиза в гражданском, арбитражном, уголовном м<br>\r\nадминистративном процессах»</p><ul>\r\n    <li>Правовые аспекты осуществления оценочной экспертизы</li>\r\n    <li>Место судебно-оценочной экспертизы в гражданском процессе</li>\r\n    <li>Место судебно-оценочной экспертизы в арбитражном процессе</li>\r\n    <li>Место судебно-оценочной экспертизы в уголовном процессе</li>\r\n    <li>Место судебно-оценочной экспертизы в административном процессе</li>\r\n    <li>Права и обязанности, ответственность эксперта</li>\r\n</ul><p>Часть 3: «Направления судебно - оценочной экспертизы»</p><ul>\r\n    <li>Экспертиза стоимости различных объектов недвижимости и их восстановительного<br>\r\n    ремонта</li>\r\n    <li>Экспертиза кадастровой стоимости объектов недвижимости (земельных участков и<br>\r\n    объектов капитального строительства)</li>\r\n    <li> Экспертиза стоимости земельных участков в целях изъятия</li>\r\n    <li> Экспертиза стоимости арендованных помещений для целей выкупа</li>\r\n    <li>Экспертиза стоимости инвестиционно-строительных объектов.</li>\r\n    <li>Экспертиза стоимости незавершенного строительства</li>\r\n    <li>Организация и проведение натурного обследования объектов недвижимости при<br>\r\n    проведении стоимостной экспертизы</li>\r\n    <li>Особенности проведения экспертизы стоимости памятников истории и архитектуры</li>\r\n    <li>Экспертиза стоимости предприятия (бизнеса)</li>\r\n    <li>Экспертиза стоимости прав требования</li>\r\n    <li> Экспертиза стоимости убытков для целей установления величины ущерба от пожара<br>\r\n    (залива)</li>\r\n    <li>Экспертиза стоимости оборота ценных бумаг</li>\r\n    <li>Экспертиза стоимости доли в ООО</li>\r\n    <li> Экспертиза стоимости векселей</li>\r\n    <li>Экспертиза стоимости машин и оборудования</li>\r\n    <li>Экспертиза стоимости объектов интеллектуальной собственности</li>\r\n</ul><p>Подробности по запросу.</p><p><strong>По окончании обучения выдается диплом</strong> о профессиональной переподготовке установленного образца с присвоением квалификации «судебный эксперт», которое может представляться в судебные инстанции в качестве документа, подтверждающего наличие уровня профессиональной подготовки судебного эксперта, дающее право на самостоятельное производство судебной экспертизы.</p><p>Одновременно с выдачей диплома выдается удостоверение Союза «ФЭСэ» (при вступлении в члены Союза ФЭСэ) об аттестации по всем видам судебных стоимостных экспертиз.<br>\r\nДанные о судебных экспертах, прошедших обучение по программе, размещаются в Справочнике финансово-экономических судебных экспертов, который направляется в суды, правоохранительные органы, адвокатуры <a href="/upload/file/2017/02/spravochnik-advokata_0.pdf">spravochnik-advokata.pdf</a><a href="http://www.finsudexpert.ru/spravochnik-advokata.pdf"></a></p><p><strong>Стоимость обучения: </strong><br>\r\n60 000 рублей для членов Союза ФЭСЭ (с рассрочкой платежа),<br>\r\nНДС не облагается.</p><p><strong>Для зачисления необходимо направить:</strong><br>\r\n1) Копию паспорта (стр. 2,3 + прописка).<br>\r\n2) Копию диплома о высшем образовании<br>\r\n3) Копию диплома о профессиональной переподготовке в области оценочной деятельности – при наличии.</p><p><strong>Руководитель программы</strong>:<br>\r\nВерхозина -Рогич Алена Валерьевна – вице-президент, генеральный директор Союза «Финансово – экономических судебных экспертов», президент саморегулируемой организации оценщиков «Федерация специалистов оценщиков».</p><hr><h3>Вопросы и заявки направлять до 15 ноября 2016 г. по электронной почте: <br>\r\n<strong>E-mail: finsudexpert@mail.ru</strong></h3><p>Тел.: +7 (495) 226-63-39<br>\r\nViber: +7 (916) 238-08-00</p><hr>', 'Korp_obuch', ' 	НП ФИНАНСОВО-ЭКОНОМИЧЕСКИХ СУДЕБНЫХ ЭКСПЕРТОВ | Корпоративное обучение и повышение квалификации в РГУП по программе СОЭ', '', 'НП ФИНАНСОВО-ЭКОНОМИЧЕСКИХ СУДЕБНЫХ ЭКСПЕРТОВ | Корпоративное обучение и повышение квалификации в РГУП по программе СОЭ', 1484889000, 1487326409, 1),
(9, 'Оплата членских взносов за 2017 год', '<p>Уважаемые члены СОЮЗА ФЭСэ просьба оплатить членские взносы за 2017 год. </p><p><a href="http://finsudexpert.ru/userfiles/file/%D0%A7%D0%BB%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9%20%D0%B2%D0%B7%D0%BD%D0%BE%D1%81%202017.doc"></a><a href="/upload/file/2017/02/2017.doc">Скачать образец квитанции</a><br></p>', 'oplata_2017', ' 	НП ФИНАНСОВО-ЭКОНОМИЧЕСКИХ СУДЕБНЫХ ЭКСПЕРТОВ | Оплата членских взносов за 2017 год', '', 'НП ФИНАНСОВО-ЭКОНОМИЧЕСКИХ СУДЕБНЫХ ЭКСПЕРТОВ | Оплата членских взносов за 2017 год', 1480839180, 1487153902, 1),
